import { CognitoUserPool } from "amazon-cognito-identity-js";

const { USER_POOL_ID, USER_POOL_CLIENT_ID } = process.env;

const poolData = {
  UserPoolId: USER_POOL_ID,
  ClientId: USER_POOL_CLIENT_ID,
};

export default new CognitoUserPool(poolData);
